// Navbar.js

import React, { useState } from 'react';

const Navbar = () => {
  const [isOpen, setIsOpen] = useState(false);

  const toggleMenu = () => {
    setIsOpen(!isOpen);
  };

  return (
    <div className="flex justify-between items-center p-4 bg-accent text-dark">
      <div className="text-lg font-bold">D.</div>
      <div className="flex items-center">
        {/* Hamburger menu button */}
        <button
          className="lg:hidden text-xl focus:outline-none"
          onClick={toggleMenu}
        >
          &#9776;
        </button>

        {/* Navigation links */}
        <div className={`lg:flex ${isOpen ? 'flex' : 'hidden'} flex-col lg:flex-row font-semibold`}>
          <div className="lg:mx-2 my-2 lg:my-0">HOME</div>
          <div className="lg:mx-2 my-2 lg:my-0">SKILLS</div>
          <div className="lg:mx-2 my-2 lg:my-0">WORKS</div>
          <div className="lg:mx-2 my-2 lg:my-0">CONTACT ME</div>
        </div>
      </div>
    </div>
  );
};

export default Navbar;
